script: |
  super -f text -I q11125.spq | sort > q11125.out

inputs:
  - name: q11125.spq
    data: |
      SELECT col1 * - 68 AS col0 FROM tab0 (FORMAT parquet) WHERE CAST ( NULL AS INTEGER ) * col2 - - - col2 + - + col0 + + col0 + + 57 BETWEEN ( col1 * + col0 ) AND ( + 7 );
  - name: tab0

outputs:
  - name: q11125.out
    data: |
